import React, { Component } from "react";

import axios from "axios";

class Door extends Component {
  userId = this.props.match.params.id;

  state = {
    door: {},
    users: [],
  };
  componentDidMount() {
    this.fetchDoorData();
  }
  render() {
    return <div> {this.state.door.name}</div>;
  }

  async fetchDoorData() {
    try {
      const result = await axios.get(
        `http://127.0.0.1:5000/doors/${this.userId}`
      );
      if (result.status === 200) {
        const currentDoor = result.data.door;
        const door = {
          id: result.data.door[0],
          name: currentDoor[1],
          dateTime: currentDoor[2],
          address: `${currentDoor[4]}, ${currentDoor[5]}, ${currentDoor[6]}, ${currentDoor[7]}, ${currentDoor[8]}`,
        };
        console.log(door);
        const currentUsers = result.data.users.map((user) => ({
          id: user[0],
          email: user[1],
          firstName: user[2],
          lastName: user[3],
          createdAt: user[4],
        }));
        this.setState({ door: door, users: currentUsers });
      }
    } catch (error) {
      console.log("Could not fetch doors at this time:", error);
    }
  }
}

export default Door;
